import FeedIcon from "@mui/icons-material/Feed";
import MoreHorizIcon from "@mui/icons-material/MoreHoriz";
import {
  Card,
  IconButton,
  Typography,
  styled,
  useMediaQuery,
  useTheme,
} from "@mui/material";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import * as React from "react";
import { useState } from "react";
import {
  CartesianGrid,
  Legend,
  Line,
  LineChart,
  ResponsiveContainer,
  Tooltip,
  XAxis,
  YAxis,
} from "recharts";
import DashTab from "../NavBar/DashTab";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

export default function BasicGrid() {
  const [age, setAge] = React.useState("");

  const [selectedOption, setSelectedOption] = useState("");

  const handleChange = (event) => {
    setSelectedOption(event.target.value);
  };

  const data = [
    { name: "0", value: 0 },
    { name: "Week 1", value: 10 },
    { name: "Week 2", value: 20 },
    { name: "Week 3", value: 30 },
    { name: "Week 4", value: 40 },
  ];

  const cardStyle = {
    padding: "10px 15px",
    margin: "20px",
    // width: "100px",
    // height: "100px",
    border: "1px solid white",
    borderShadow: "",
    borderRadius: "10px",
    background: "linear-gradient(to right, rgb(164 63 177), rgb(56 103 175))",
  };

  const theme = useTheme();
  const isSmallScreen = useMediaQuery(theme.breakpoints.down("sm"));

  return (
    <>
      <Grid>
        <Box sx={{ flexGrow: 1, marginTop: "3%" }}>
          <Grid container spacing={2}>
            <Grid item xs={12} md={6} sx={{ height: "100%" }}>
              <Card
                sx={{
                  width: "100%",
                  display: "flex",
                  flexDirection: "column",
                  background: "#80808052",
                }}
              >
                <Grid
                  container
                  sx={{
                    display: "flex",
                    flexDirection: "row",

                    justifyContent: "center",
                  }}
                >
                  <Grid item textAlign={"left"} xs={12} md={10}>
                    <strong
                      style={{
                        // fontWeight: "bold",
                        padding: "30px",
                        fontSize: "30px",

                        color: "white",
                      }}
                    >
                      Sales
                    </strong>
                  </Grid>

                  <Grid item textAlign={"center"} xs={12} md={2}>
                    <IconButton
                      size="large"
                      aria-label="display more actions"
                      edge="end"
                      sx={{ color: "white" }}
                    >
                      <MoreHorizIcon />
                    </IconButton>
                  </Grid>
                </Grid>

                {/******Cards **********/}
                <Grid
                  container
                  sx={{
                    display: "flex",
                    flexDirection: "row",
                    alignItems: "center",
                    justifyContent: "center",
                  }}
                >
                  <Grid item xs={12} sm={4} md={2} style={cardStyle}>
                    <Typography
                      sx={{
                        color: "white",
                        fontSize: "30px",
                        marginTop: "5px",
                      }}
                    >
                      500
                    </Typography>
                    <Typography sx={{ color: "white" }}>Orders</Typography>
                  </Grid>
                  <Grid item xs={12} sm={4} md={2} style={cardStyle}>
                    <Typography sx={{ color: "white", fontSize: "30px" }}>
                      200
                    </Typography>
                    <Typography sx={{ color: "white" }}>Delivered</Typography>
                  </Grid>
                  <Grid item xs={12} sm={4} md={2} style={cardStyle}>
                    <Typography sx={{ color: "white", fontSize: "30px" }}>
                      100
                    </Typography>
                    <Typography sx={{ color: "white" }}>Pending</Typography>
                  </Grid>
                  <Grid item xs={12} sm={4} md={2} style={cardStyle}>
                    <Typography sx={{ color: "white", fontSize: "30px" }}>
                      500
                    </Typography>
                    <Typography sx={{ color: "white" }}>Packed</Typography>
                  </Grid>
                </Grid>
              </Card>

              <DashTab />
            </Grid>

            {/* Graph */}

            <Grid item xs={12} md={6}>
              <Item
                sx={{
                  background: "#80808052",
                }}
              >
                <Grid
                  container
                  sx={{
                    display: "flex",
                    flexDirection: "row",

                    justifyContent: "center",
                  }}
                >
                  <Grid item textAlign={"left"} xs={12} md={10}>
                    <strong
                      style={{
                        // fontWeight: "bold",
                        padding: "30px",
                        fontSize: "25px",

                        color: "white",
                      }}
                    >
                      Monthly Report
                    </strong>
                  </Grid>

                  <Grid item textAlign={"center"} xs={12} md={2}>
                    <IconButton
                      size="large"
                      aria-label="display more actions"
                      edge="end"
                      sx={{ color: "white" }}
                    >
